    //             _disableID(userIDAccount);
    //             emit IDDeactivated(userIDAccount.id, "Last staking over");
    //         }
    //     }
    // }

    // function claimROI(uint32 _id) external {
    //     uint256 roiClaimed = _claimROI(_id);
    //     _payReferal(roiClaimed, _id);
